than a game it\'s a craft at least almost a science let\'s ask an expert Bert Rhodes of Derbyshire the bonus a late break on this demonstration wicked now there\'s the spinning finger the third one see coddled close against the same he comes up now this is the perfect leg break watch where it pitches just outside the line of the leg stump and it turns enough to beat the off stump and now the Orthodox the natural breaks spun off that index finger the off break and this pitch is what it outside the line of the off stump and it beats the leg stump now that\'s the right arm bowlers Orthodox weapon let\'s see how the batsman copes with it as the ball comes down to him turning into him but all right he just lets it hit the bed that\'s why short leg fields when were born well perhaps attacks the best method of defense then comes an off break again and the batsman hooks it hard and high over those short leg fields Minh but not over deep square leg there is a way of doing it of course over the ball as it moves into you and push it away along the ground as edge rich does this ball from Linville playing it to barns when England earned 27 for 1 which is nothing for Englishmen to be very happy about and rail in ball is bowling at full speed to Hutton that balls well up Germany pushes it away past mid off for a comfortable 2 Bradman moves round those hungry Australian strip fields Minh and Linville in one of the finest spells of fast bowling seen in England since la would Bulls again this time to aid rich and Ed rich pushes him away out into the covers quite safely while experts battle experts Forge the weapons that they use good fight willow with a wholesome heart long seasons like the manor who shape it skilled hands practicing a long-established craft for wasn\'t John small the cobbler making cricket balls at Hambledon 200 years ago since then the craft has grown and yet there still remains the steadiness of eye and hand that sews the seeds seems that in the bolas hands will give the hidden feel for breaks and twists seems to withstand the onslaught of the bat for the heart of a bat is firm till its blows have strength and punch yes it got punch all right power it doesn\'t get there by accident take the handle now it\'s cane and rubber springing to wit because it\'s got to when a Hut nura bradman drives a fast bowler far away there\'s got to be good splicing for that kind of thing too but cricket and craftsmanship go hand in hand and when handle meets blade in a cricket bat you\'ve got a real piece of craftsmanship it\'s the same with a ball sewn firm and tight and when it\'s done a durable balanced projectile carefully weighed and measured and graded as precise in its making as the hands that will use it as precise as precise as a cricket bat first-class weapons one designed to break or swing and beat the bat and the other to fathom the tricks of the bowler and send the ball far away and it takes doug writer number 11 with a wild swing over the boners head sky high up there into the long field to save England from the follow-on and raelynne will with four wickets already in the match Bulls again from the pavilion end and bowls Alec Benson an England are all out for 215 135 behind Australia on the first innings only some long faces in the printing room at this news there\'s quite an organisation down there they keep abreast with the play recording of fall of each wicket and the scores so that late arrivals can pick up the score in detail straight away as they come in of Australia 135 in front they\'ll probably think that\'s a pretty sad three pennyworth but now Australian started their second innings bed sir both the bonds his inswinger and bonds puts it away down to long leg Ron comes Hutton building at long leg and there\'s that quick low throw to Godfrey Evans and now right Bulls to Morris and he\'s out when a wicked Falls or hit is made those behind the scenes spring into action what dear accord we\'ll go speeding over land and ocean